    e.preventDefault()
    let key = e.target.name
    let value = e.target.value
    setSearch(...search, [key] = value)
    console.log('!!!!!!', key, value)
  }

  const submitHandler = (e) => {
    e.preventDefault()
    console.log(e)
  }

